;; <=

;; **
;;; That looks promising. We are now in a position to implement a function to generate the initial population. We'll include a range of tree sizes for variety.
;; **

;; @@
;(rand-int 100)
;(repeatedly 10 #(rand-int 10)) -- so this will apply the rand-int function and select integers 10 times and return a liust
;so this is going to create a list of trees of various depths up to the maximum depth
;all of these trees are of the same type


(defn make-initial-population
  [n max-depth]
  (repeatedly n #(random-full-tree functions terminals (+ 1 (rand-int (- max-depth 1))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;sr-basis/make-initial-population</span>","value":"#'sr-basis/make-initial-population"}
