;; **
;;; The score function itself is easy to implement.
;; **

;; @@
; (apply max [1 2 3])  max normally takes a series of values (max 1 2 3) it does not take a vector apply takes a vector and 
; alters it and applies it to max
; (first [1 2 3]) gibes the result of 1
; (second [1 2 3]) gives the result 2
; #(* (first %) (second %)) is a shortcut for making an anonymous function
; (map fn data) will apply the fn to each element of data

(defn score
  [data ex]
  (let [f (functionalise ex)]
    (* -1 (apply + (map #(* (- (f (first %)) (second %)) (- (f (first %)) (second %))) data))))); this is squaring and summing
; I think that f(first %) finds the value from the x coordinate and then compares with the empirical value
; so we will input ( [x1,y1] [x2 y2] [x3 y3])
;; @@
